import React from "react";
export default function Form() {
  return (
    <>
      <div>
        <form>
          <h3 class="input-container">
            Login Page
            <br></br>
            <br></br>
            <input placeholder="YourName" />
            <br></br>
            <input placeholder="xyz@pqr.com" />
            <br></br>
            <button
              onClick={(e) => {
                e.preventDefault();
                // console.log("don't reload");
              }}
            >
              Login
            </button>
          </h3>
        </form>
      </div>
    </>
  );
}
